import React from 'react'
import Title from './Title.js';
import {Container,Row,Col} from 'react-bootstrap';
import './ToDoStyle.css';

export default function Kanban() {
    return (
        <Container fluid style={{backgroundColor:"#4D4D5C",paddingTop:"30px"}} >
            <Row className='mx-auto'>
                <Col md={4}className=''><Title title="ToDo"/></Col>
                <Col sm={4} className='justify-content-center'><Title title="Doing"/></Col>
                <Col m={4} className='justify-content-center'><Title title="Done"/></Col>
            </Row>
        </Container>
    )
}
